from rest_framework.test import APITestCase
from rest_framework import status
from django.urls import reverse
import todo
from todo.models import Todo


class HelperTestTodo(APITestCase):
    
    token = None

    def authenticate(self):
        self.client.post(
            reverse('register'),
            {
                'username': 'palmonaz',
                'email': 'palmonaz@palmonaz.com',
                'password': 'daje72'
            }
        )
        # get token
        ret = self.client.post(
            reverse('login'),
            {
                'email': 'palmonaz@palmonaz.com',
                'password': 'daje72'
            }
        )
        # set credential
        self.client.credentials(HTTP_AUTHORIZATION=f"Bearer {ret.data['token']}")


    def create_todo(self):
        if self.token is None:
            self.authenticate()
        return self.client.post(
                reverse('todo-list-create'),
                {
                    'name': 'test todo create',
                    'description': 'test todo create description',
                    'image':''                 
                }
            )
    
    def update_todo(self, id, kvargs):
        if self.token is None:
            self.authenticate()
        todobj = Todo.objects.get(id=id)
        return self.client.patch(
                reverse('todo-retrive-update', kwargs={'id': id}),
                kvargs)
    
    def delete_todo(self, id):
        if self.token is None:
            self.authenticate()
        return self.client.delete(
                reverse('todo-retrive-update', kwargs={'id': id}))
    
        

class TestTodo(HelperTestTodo):

    def test_create_forbidden(self):
        # self.client is a client
        payload = {
            'name': 'test todo 1',
            'description': 'it has to fail because forbidden'
        }
        ret = self.client.post(
            reverse("todo-list-create"),
            payload
            )
        self.assertEqual(ret.status_code, status.HTTP_403_FORBIDDEN)


    def test_register_login_userinfo(self):
        self.authenticate()
        ret = self.client.get(
            reverse('userinfo'),
        )
        self.assertEqual(ret.status_code, status.HTTP_200_OK)

    
    def test_create(self):
        howmany = Todo.objects.all().count()
        ret = self.create_todo()
        self.assertEqual(ret.status_code, status.HTTP_201_CREATED)
        self.assertEqual(
            Todo.objects.all().count(),
            howmany + 1
        )

    def test_update(self):
        ret = self.create_todo()
        ret = self.update_todo(ret.data['id'],{'name': 'test update name',})
        self.assertEqual(ret.status_code, status.HTTP_200_OK)
        todoobj = Todo.objects.get(id=ret.data['id'])
        self.assertEqual(todoobj.name, 'test update name')


    def test_delete(self):
        ret = self.create_todo()
        howmany = Todo.objects.all().count()
        self.assertGreater(howmany, 0)
        ret = self.delete_todo(id=ret.data['id'])
        self.assertEqual(ret.status_code, status.HTTP_204_NO_CONTENT)
        self.assertEqual(Todo.objects.all().count(), howmany - 1)


        
